    padding: 4,
    minHeight: 600,
    display: "flex",
    alignItems: "center",
    justifyContent: "center"
  }}>
      <Stack maxWidth={400} spacing={2} textAlign="center">
        <img src="/static/illustration/payment-complete.svg" width="100%" alt="Payment Complete" />
